/**html
 * 品牌名稱 文章標題
 * <input onblur="injectValidate(checkInputType(this.value, true), `.errMsgPart`)" />
 <span class="errMsgPart"></span>    <= 若有span則把class名稱加在span原本htmlTag的span中，沒有的話要自行新增
 * 
 * 作者名稱、加標籤
 * <input onblur="injectValidate(checkInputType(this.value, false), `.errMsgPart`)" />

  <span class="errMsgPart"></span>    <= 若有span則把class名稱加在span原本htmlTag的span中，沒有的話要自行新增

 */
// 把需要跳出錯誤訊息注入到DOM
function injectValidate(noPass, domName) {
  const checkTypeMsg = `<p style="color:red" id="domErrMsg">
        偵測到欄位中含有不支援之特殊字型或符號，需請您調整修正文字
        <a style="font-weight:900 color:#1E8ACC" 
        href="https://solomo.xinmedia.com/travelpoint/178477"
        target="_blank"
        rel="noopener noreferrer" >
          (詳細規範)
        </a>
      </p>`;

  const errElementDom = document.querySelector("#domErrMsg");

  // console.log("errElementDom", !!errElementDom);

  if (!noPass) {
    document.querySelector(domName).innerHTML = checkTypeMsg;
  } else if (!!errElementDom && noPass) {
    errElementDom.parentNode.removeChild(errElementDom);
  }
}